import React from 'react'

namespace Btn {
    export interface Props {
        children?: React.ReactNode
        onMouseEnter?: () => void
        onMouseLeave?: () => void
        [propName: string]: any
        size?: "big" | "small"
        borderRadius?: string
        onClick?: () => void
        focusable?: boolean
        className?: string
        content?: string
        height?: string
        color?: string
        width?: string
        base?: boolean
    }
}

export default function Button(props: Btn.Props) {

    return (
        <div 
            className={props.className}
            onClick={props.onClick}
            onMouseEnter={props.onMouseEnter}
            onMouseLeave={props.onMouseLeave}
        >
            {props.content}
        </div>
    )
}
